//Reducer
const reducer = (state = [], action) => {
    if(action.type == "LOGGED"){

        return [{
            Logged: true
        }]
    }
    else if (action.type == "SIGN_OUT"){

        return [{
            Logged: false
        }]
    }
    else{

        return state;
    }

}

export default reducer;
